import logo from './logo.svg';
import './design.css';
import {Routes,Route} from 'react-router-dom'

import Header from './Components/Header';
import Footer from './Components/Footer';
import Homepage from './Components/Homepage';
import ProductDetails from './Components/ProductDetails';
import Auth from './Components/Auth';
import Register from './Components/Register';
import {useEffect} from 'react'
import {getMe} from './Store/Actions/authActions'
import {useDispatch,useSelector} from 'react-redux'
import Profile from './Components/Profile';
import store from './Store/store';


const App =(props)=> {
  const user = useSelector(state => state.auth.user)



  const dispatch = useDispatch()

  useEffect(() =>{
    dispatch(getMe())

  },[])

  return (
    <div className="App">
      <Header />
      <Routes>
      <Route exact path="/" element={<Homepage/>}>
        </Route>

      <Route path="/search/:keyword" element={<Homepage/>}>
        </Route>

        <Route path="/user/login" element={<Auth/>}>
        </Route>

        <Route path="/user/reg" element={<Register/>}>
        </Route>


      {user && (<Route path="/user/my-profile" element={<Profile/>}>
        </Route>)}

        <Route exact path={`/product/:id`} children={({ match }) => (
    match)} element={<ProductDetails props={props}/>}>
        </Route>
    </Routes>
      <Footer />

    </div>
  );
}

export default App;
